import React, { useState } from 'react';
import './App.css';
import './components/TopBar/TopBar'
import './components/Dash/Dash'
import TopBar from './components/TopBar/TopBar';
import Dash from './components/Dash/Dash';
// import SquarePanel from './components/SquarePanel/SquarePanel';
import MidPanel from './components/MidPanel/MidPanel';
import FullPanel from './components/FullPanel/FullPanel';
/* import FullPanel1 from './components/FullPanel/FullPanel1';
*  */
import About from './components/About/About';
import { BrowserRouter as Router, Route, Link, Routes } from 'react-router-dom';

const dynamicRoutes = [
  { path: '/something/subroute1', component: 'Subroute1' },
  { path: '/something/subroute2', component: 'Subroute2' },
  // Add more routes as needed
];

const App: React.FC = () => {
  return (
    <Router>
      <div>
        <nav>
          <ul>
            <li>
              <Link to="/">About</Link>
            </li>
            <li>
              <Link to="/about">About</Link>
            </li>
            {dynamicRoutes.map((route) => (
              <li key={route.path}>
                <Link to={route.path}>{route.path}</Link>
              </li>
            ))}
          </ul>
        </nav>

        <Routes>
          <Route path="/about" element={<About />} />
          <Route path="/" element={<About />} />
          {dynamicRoutes.map((route) => (
            <Route
              key={route.path}
              path={route.path}
              element={React.createElement(require(`./components/${route.component}`).default)}
            />
          ))}
        </Routes>
      </div>
    </Router>
  );
};

export default App;
